wait_id = function(assertion) {
  var xhr;
  if (me.id.length !== 40) {
    return setTimeout(wait_id, 137);
  }
  xhr = $.post("/auth/link", {
    assertion: assertion,
    id: me.id
  });
  xhr.success(function(data) {
    var json;
    $('#userinfo').fadeIn();
    json = JSON.parse(data);
    window.logged_in_user = json.email;
    $("#signin").hide();
    $(".user-name").text(json.username);
    return $("#user").show();
  });
  return xhr.error(function(data) {
    $('#userinfo').fadeIn();
    return logAnnotation(data.responseText);
  });
};

$("a[href='/signin']").click(function(e) {
  e.preventDefault();
  return navigator.id.request();
});

$("a[href='/logout']").click(function(e) {
  e.preventDefault();
  return navigator.id.logout();
});
